// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title MockGovernance
 * @dev Mock governance contract for testing DAO Registry functionality
 */
contract MockGovernance is Ownable, ReentrancyGuard {
    using Counters for Counters.Counter;

    // Governance token
    IERC20 public governanceToken;
    address public daoRegistry;

    // Proposal tracking
    Counters.Counter private _proposalIds;
    mapping(uint256 => Proposal) public proposals;
    mapping(uint256 => mapping(address => Vote)) public votes;
    mapping(uint256 => mapping(address => bool)) public hasVoted;

    // Governance parameters
    uint256 public votingPeriod = 86400; // 1 day
    uint256 public quorumVotes = 1000; // 10% in basis points
    uint256 public proposalThreshold = 1000; // Minimum tokens to propose

    struct Proposal {
        uint256 id;
        address proposer;
        string title;
        string description;
        uint256 startTime;
        uint256 endTime;
        uint256 forVotes;
        uint256 againstVotes;
        uint256 abstainVotes;
        bool executed;
        bool canceled;
        uint256 executedAt;
        ProposalStatus status;
        ProposalAction[] actions;
    }

    struct ProposalAction {
        address target;
        uint256 value;
        string signature;
        bytes data;
    }

    struct Vote {
        uint8 support; // 0 = against, 1 = for, 2 = abstain
        uint256 weight;
        string reason;
    }

    enum ProposalStatus {
        Pending,
        Active,
        Succeeded,
        Defeated,
        Executed,
        Canceled,
        Expired
    }

    // Events
    event ProposalCreated(
        uint256 indexed proposalId,
        address indexed proposer,
        string title,
        uint256 startTime,
        uint256 endTime
    );
    event VoteCast(
        uint256 indexed proposalId,
        address indexed voter,
        uint8 support,
        uint256 weight,
        string reason
    );
    event ProposalExecuted(uint256 indexed proposalId);
    event ProposalCanceled(uint256 indexed proposalId);
    event GovernanceParametersUpdated(
        uint256 votingPeriod,
        uint256 quorumVotes,
        uint256 proposalThreshold
    );

    constructor(address _governanceToken, address _daoRegistry) {
        governanceToken = IERC20(_governanceToken);
        daoRegistry = _daoRegistry;
    }

    /**
     * @dev Create a new proposal
     * @param title Proposal title
     * @param description Proposal description
     * @param actions Proposed actions
     */
    function propose(
        string memory title,
        string memory description,
        ProposalAction[] memory actions
    ) external nonReentrant returns (uint256) {
        require(
            governanceToken.balanceOf(msg.sender) >= proposalThreshold,
            "Insufficient tokens to propose"
        );

        _proposalIds.increment();
        uint256 proposalId = _proposalIds.current();

        uint256 startTime = block.timestamp;
        uint256 endTime = startTime + votingPeriod;

        proposals[proposalId] = Proposal({
            id: proposalId,
            proposer: msg.sender,
            title: title,
            description: description,
            startTime: startTime,
            endTime: endTime,
            forVotes: 0,
            againstVotes: 0,
            abstainVotes: 0,
            executed: false,
            canceled: false,
            executedAt: 0,
            status: ProposalStatus.Active,
            actions: actions
        });

        emit ProposalCreated(proposalId, msg.sender, title, startTime, endTime);

        return proposalId;
    }

    /**
     * @dev Vote on a proposal
     * @param proposalId Proposal ID
     * @param support Vote support (0 = against, 1 = for, 2 = abstain)
     * @param reason Voting reason
     */
    function castVote(
        uint256 proposalId,
        uint8 support,
        string memory reason
    ) external nonReentrant {
        require(proposalId > 0 && proposalId <= _proposalIds.current(), "Invalid proposal");
        require(support <= 2, "Invalid support value");
        require(!hasVoted[proposalId][msg.sender], "Already voted");

        Proposal storage proposal = proposals[proposalId];
        require(proposal.status == ProposalStatus.Active, "Proposal not active");
        require(block.timestamp >= proposal.startTime, "Voting not started");
        require(block.timestamp <= proposal.endTime, "Voting ended");

        uint256 weight = governanceToken.balanceOf(msg.sender);
        require(weight > 0, "No voting power");

        hasVoted[proposalId][msg.sender] = true;
        votes[proposalId][msg.sender] = Vote({
            support: support,
            weight: weight,
            reason: reason
        });

        if (support == 0) {
            proposal.againstVotes += weight;
        } else if (support == 1) {
            proposal.forVotes += weight;
        } else if (support == 2) {
            proposal.abstainVotes += weight;
        }

        emit VoteCast(proposalId, msg.sender, support, weight, reason);
    }

    /**
     * @dev Execute a proposal
     * @param proposalId Proposal ID
     */
    function execute(uint256 proposalId) external nonReentrant {
        require(proposalId > 0 && proposalId <= _proposalIds.current(), "Invalid proposal");

        Proposal storage proposal = proposals[proposalId];
        require(proposal.status == ProposalStatus.Succeeded, "Proposal not succeeded");
        require(!proposal.executed, "Proposal already executed");
        require(block.timestamp >= proposal.endTime, "Voting period not ended");

        proposal.executed = true;
        proposal.executedAt = block.timestamp;
        proposal.status = ProposalStatus.Executed;

        // Execute actions
        for (uint256 i = 0; i < proposal.actions.length; i++) {
            ProposalAction memory action = proposal.actions[i];
            (bool success, ) = action.target.call{value: action.value}(action.data);
            require(success, "Action execution failed");
        }

        emit ProposalExecuted(proposalId);
    }

    /**
     * @dev Cancel a proposal (only proposer or owner)
     * @param proposalId Proposal ID
     */
    function cancel(uint256 proposalId) external {
        require(proposalId > 0 && proposalId <= _proposalIds.current(), "Invalid proposal");

        Proposal storage proposal = proposals[proposalId];
        require(
            msg.sender == proposal.proposer || msg.sender == owner(),
            "Not authorized to cancel"
        );
        require(proposal.status == ProposalStatus.Active, "Proposal not active");

        proposal.canceled = true;
        proposal.status = ProposalStatus.Canceled;

        emit ProposalCanceled(proposalId);
    }

    /**
     * @dev Update proposal status based on voting results
     * @param proposalId Proposal ID
     */
    function updateProposalStatus(uint256 proposalId) external {
        require(proposalId > 0 && proposalId <= _proposalIds.current(), "Invalid proposal");

        Proposal storage proposal = proposals[proposalId];
        require(proposal.status == ProposalStatus.Active, "Proposal not active");
        require(block.timestamp >= proposal.endTime, "Voting period not ended");

        uint256 totalVotes = proposal.forVotes + proposal.againstVotes + proposal.abstainVotes;
        uint256 totalSupply = governanceToken.totalSupply();

        if (totalVotes >= (totalSupply * quorumVotes) / 10000) {
            if (proposal.forVotes > proposal.againstVotes) {
                proposal.status = ProposalStatus.Succeeded;
            } else {
                proposal.status = ProposalStatus.Defeated;
            }
        } else {
            proposal.status = ProposalStatus.Defeated;
        }
    }

    /**
     * @dev Get proposal information
     * @param proposalId Proposal ID
     * @return id Proposal ID
     * @return proposer Proposer address
     * @return title Proposal title
     * @return description Proposal description
     * @return startTime Proposal start time
     * @return endTime Proposal end time
     * @return forVotes Votes in favor
     * @return againstVotes Votes against
     * @return abstainVotes Abstain votes
     * @return executed Whether proposal was executed
     * @return canceled Whether proposal was canceled
     * @return executedAt Execution timestamp
     * @return status Proposal status
     */
    function getProposal(uint256 proposalId)
        external
        view
        returns (
            uint256 id,
            address proposer,
            string memory title,
            string memory description,
            uint256 startTime,
            uint256 endTime,
            uint256 forVotes,
            uint256 againstVotes,
            uint256 abstainVotes,
            bool executed,
            bool canceled,
            uint256 executedAt,
            ProposalStatus status
        )
    {
        require(proposalId > 0 && proposalId <= _proposalIds.current(), "Invalid proposal");
        Proposal storage proposal = proposals[proposalId];

        return (
            proposal.id,
            proposal.proposer,
            proposal.title,
            proposal.description,
            proposal.startTime,
            proposal.endTime,
            proposal.forVotes,
            proposal.againstVotes,
            proposal.abstainVotes,
            proposal.executed,
            proposal.canceled,
            proposal.executedAt,
            proposal.status
        );
    }

    /**
     * @dev Get vote information
     * @param proposalId Proposal ID
     * @param voter Voter address
     * @return support Support type (0=Against, 1=For, 2=Abstain)
     * @return weight Voting weight
     * @return reason Reason for vote
     */
    function getVote(uint256 proposalId, address voter)
        external
        view
        returns (
            uint8 support,
            uint256 weight,
            string memory reason
        )
    {
        require(proposalId > 0 && proposalId <= _proposalIds.current(), "Invalid proposal");
        Vote storage vote = votes[proposalId][voter];

        return (vote.support, vote.weight, vote.reason);
    }

    /**
     * @dev Check if address has voted on proposal
     * @param proposalId Proposal ID
     * @param voter Voter address
     * @return True if has voted
     */
    function hasVotedOnProposal(uint256 proposalId, address voter)
        external
        view
        returns (bool)
    {
        return hasVoted[proposalId][voter];
    }

    /**
     * @dev Get voting power for address
     * @param account Address to check
     * @return Voting power
     */
    function getVotingPower(address account) external view returns (uint256) {
        return governanceToken.balanceOf(account);
    }

    /**
     * @dev Get total proposals count
     * @return Total proposals
     */
    function getTotalProposals() external view returns (uint256) {
        return _proposalIds.current();
    }

    /**
     * @dev Update governance parameters (only owner)
     * @param newVotingPeriod New voting period
     * @param newQuorumVotes New quorum votes
     * @param newProposalThreshold New proposal threshold
     */
    function updateGovernanceParameters(
        uint256 newVotingPeriod,
        uint256 newQuorumVotes,
        uint256 newProposalThreshold
    ) external onlyOwner {
        votingPeriod = newVotingPeriod;
        quorumVotes = newQuorumVotes;
        proposalThreshold = newProposalThreshold;

        emit GovernanceParametersUpdated(
            newVotingPeriod,
            newQuorumVotes,
            newProposalThreshold
        );
    }

    /**
     * @dev Get governance parameters
     * @return votingPeriod Current voting period
     * @return quorumVotes Current quorum votes
     * @return proposalThreshold Current proposal threshold
     */
    function getGovernanceParameters()
        external
        view
        returns (
            uint256 votingPeriod,
            uint256 quorumVotes,
            uint256 proposalThreshold
        )
    {
        return (votingPeriod, quorumVotes, proposalThreshold);
    }

    /**
     * @dev Get proposal actions
     * @param proposalId Proposal ID
     * @return actions Array of proposal actions
     */
    function getProposalActions(uint256 proposalId)
        external
        view
        returns (ProposalAction[] memory actions)
    {
        require(proposalId > 0 && proposalId <= _proposalIds.current(), "Invalid proposal");
        return proposals[proposalId].actions;
    }

    /**
     * @dev Get proposal state
     * @param proposalId Proposal ID
     * @return state Proposal state string
     */
    function getProposalState(uint256 proposalId)
        external
        view
        returns (string memory state)
    {
        require(proposalId > 0 && proposalId <= _proposalIds.current(), "Invalid proposal");
        Proposal storage proposal = proposals[proposalId];

        if (proposal.canceled) {
            return "Canceled";
        } else if (proposal.executed) {
            return "Executed";
        } else if (block.timestamp < proposal.startTime) {
            return "Pending";
        } else if (block.timestamp <= proposal.endTime) {
            return "Active";
        } else if (proposal.status == ProposalStatus.Succeeded) {
            return "Succeeded";
        } else {
            return "Defeated";
        }
    }
}

contracts/MockTreasury.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

/**
 * @title MockTreasury
 * @dev Mock treasury contract for testing DAO Registry functionality
 */
contract MockTreasury is Ownable, ReentrancyGuard {
    // Treasury balances
    mapping(address => uint256) public ethBalance;
    mapping(address => mapping(address => uint256)) public tokenBalances;
    mapping(address => mapping(uint256 => bool)) public nftBalances;

    // Treasury info
    string public name;
    string public description;
    uint256 public totalValue;
    uint256 public lastUpdated;

    // Events
    event ETHDeposited(address indexed from, uint256 amount);
    event ETHWithdrawn(address indexed to, uint256 amount);
    event TokenDeposited(address indexed token, address indexed from, uint256 amount);
    event TokenWithdrawn(address indexed token, address indexed to, uint256 amount);
    event NFTDeposited(address indexed nft, address indexed from, uint256 tokenId);
    event NFTWithdrawn(address indexed nft, address indexed to, uint256 tokenId);
    event TreasuryUpdated(uint256 totalValue, uint256 timestamp);

    constructor() {
        name = "Mock DAO Treasury";
        description = "A mock treasury for testing DAO Registry functionality";
        lastUpdated = block.timestamp;
    }

    /**
     * @dev Deposit ETH to treasury
     */
    function depositETH() public payable nonReentrant {
        require(msg.value > 0, "Must deposit some ETH");

        ethBalance[msg.sender] += msg.value;
        totalValue += msg.value;
        lastUpdated = block.timestamp;

        emit ETHDeposited(msg.sender, msg.value);
        emit TreasuryUpdated(totalValue, block.timestamp);
    }

    /**
     * @dev Withdraw ETH from treasury (only owner)
     * @param to Recipient address
     * @param amount Amount to withdraw
     */
    function withdrawETH(address to, uint256 amount) external onlyOwner nonReentrant {
        require(amount > 0, "Amount must be greater than 0");
        require(amount <= address(this).balance, "Insufficient ETH balance");
        require(to != address(0), "Invalid recipient address");

        ethBalance[owner()] -= amount;
        totalValue -= amount;
        lastUpdated = block.timestamp;

        (bool success, ) = payable(to).call{value: amount}("");
        require(success, "ETH transfer failed");

        emit ETHWithdrawn(to, amount);
        emit TreasuryUpdated(totalValue, block.timestamp);
    }

    /**
     * @dev Deposit ERC20 tokens to treasury
     * @param token Token address
     * @param amount Amount to deposit
     */
    function depositToken(address token, uint256 amount) external nonReentrant {
        require(token != address(0), "Invalid token address");
        require(amount > 0, "Amount must be greater than 0");

        IERC20 tokenContract = IERC20(token);
        require(
            tokenContract.transferFrom(msg.sender, address(this), amount),
            "Token transfer failed"
        );

        tokenBalances[token][msg.sender] += amount;
        totalValue += amount; // Simplified - in real implementation would get USD value
        lastUpdated = block.timestamp;

        emit TokenDeposited(token, msg.sender, amount);
        emit TreasuryUpdated(totalValue, block.timestamp);
    }

    /**
     * @dev Withdraw ERC20 tokens from treasury (only owner)
     * @param token Token address
     * @param to Recipient address
     * @param amount Amount to withdraw
     */
    function withdrawToken(
        address token,
        address to,
        uint256 amount
    ) external onlyOwner nonReentrant {
        require(token != address(0), "Invalid token address");
        require(amount > 0, "Amount must be greater than 0");
        require(to != address(0), "Invalid recipient address");

        IERC20 tokenContract = IERC20(token);
        require(
            tokenContract.balanceOf(address(this)) >= amount,
            "Insufficient token balance"
        );

        tokenBalances[token][owner()] -= amount;
        totalValue -= amount; // Simplified
        lastUpdated = block.timestamp;

        require(tokenContract.transfer(to, amount), "Token transfer failed");

        emit TokenWithdrawn(token, to, amount);
        emit TreasuryUpdated(totalValue, block.timestamp);
    }

    /**
     * @dev Deposit NFT to treasury
     * @param nft NFT contract address
     * @param tokenId Token ID
     */
    function depositNFT(address nft, uint256 tokenId) external nonReentrant {
        require(nft != address(0), "Invalid NFT address");

        IERC721 nftContract = IERC721(nft);
        require(
            nftContract.ownerOf(tokenId) == msg.sender,
            "Not the owner of this NFT"
        );

        nftContract.transferFrom(msg.sender, address(this), tokenId);
        nftBalances[nft][tokenId] = true;
        totalValue += 1; // Simplified - in real implementation would get USD value
        lastUpdated = block.timestamp;

        emit NFTDeposited(nft, msg.sender, tokenId);
        emit TreasuryUpdated(totalValue, block.timestamp);
    }

    /**
     * @dev Withdraw NFT from treasury (only owner)
     * @param nft NFT contract address
     * @param to Recipient address
     * @param tokenId Token ID
     */
    function withdrawNFT(
        address nft,
        address to,
        uint256 tokenId
    ) external onlyOwner nonReentrant {
        require(nft != address(0), "Invalid NFT address");
        require(to != address(0), "Invalid recipient address");
        require(nftBalances[nft][tokenId], "NFT not in treasury");

        IERC721 nftContract = IERC721(nft);
        nftContract.transferFrom(address(this), to, tokenId);
        nftBalances[nft][tokenId] = false;
        totalValue -= 1; // Simplified
        lastUpdated = block.timestamp;

        emit NFTWithdrawn(nft, to, tokenId);
        emit TreasuryUpdated(totalValue, block.timestamp);
    }

    /**
     * @dev Get treasury balance for a specific address
     * @param account Address to check
     * @return ethBal ETH balance
     * @return tokenCount Number of different tokens
     * @return nftCount Number of NFTs
     */
    function getAccountBalance(address account)
        external
        view
        returns (
            uint256 ethBal,
            uint256 tokenCount,
            uint256 nftCount
        )
    {
        ethBal = ethBalance[account];

        // Note: This is a simplified implementation
        // In a real implementation, you would track token types and NFT counts
        tokenCount = 0;
        nftCount = 0;
    }

    /**
     * @dev Get treasury statistics
     * @return totalETH Total ETH balance
     * @return totalTokens Total token value
     * @return totalNFTs Total NFT count
     * @return lastUpdate Last update timestamp
     */
    function getTreasuryStats()
        external
        view
        returns (
            uint256 totalETH,
            uint256 totalTokens,
            uint256 totalNFTs,
            uint256 lastUpdate
        )
    {
        totalETH = address(this).balance;
        totalTokens = totalValue - totalETH; // Simplified
        totalNFTs = 0; // Would need to track NFT count
        lastUpdate = lastUpdated;
    }

    /**
     * @dev Check if treasury has sufficient balance
     * @param token Token address (address(0) for ETH)
     * @param amount Amount to check
     * @return True if sufficient balance
     */
    function hasSufficientBalance(address token, uint256 amount)
        external
        view
        returns (bool)
    {
        if (token == address(0)) {
            return address(this).balance >= amount;
        } else {
            IERC20 tokenContract = IERC20(token);
            return tokenContract.balanceOf(address(this)) >= amount;
        }
    }

    /**
     * @dev Get treasury value in USD (mock implementation)
     * @return value Treasury value in USD (scaled by 1e18)
     */
    function getTreasuryValueUSD() external view returns (uint256 value) {
        // Mock implementation - in real scenario would use price oracles
        return totalValue * 2000; // Assume 1 ETH = $2000
    }

    /**
     * @dev Update treasury name and description (only owner)
     * @param newName New treasury name
     * @param newDescription New treasury description
     */
    function updateTreasuryInfo(
        string memory newName,
        string memory newDescription
    ) external onlyOwner {
        name = newName;
        description = newDescription;
        lastUpdated = block.timestamp;
    }

    /**
     * @dev Emergency function to recover stuck tokens
     * @param tokenAddress Token address to recover
     * @param to Recipient address
     * @param amount Amount to recover
     */
    function emergencyRecoverTokens(
        address tokenAddress,
        address to,
        uint256 amount
    ) external onlyOwner {
        IERC20 token = IERC20(tokenAddress);
        require(token.transfer(to, amount), "Transfer failed");
    }

    /**
     * @dev Emergency function to recover stuck NFTs
     * @param nftAddress NFT address to recover
     * @param to Recipient address
     * @param tokenId Token ID to recover
     */
    function emergencyRecoverNFT(
        address nftAddress,
        address to,
        uint256 tokenId
    ) external onlyOwner {
        IERC721 nft = IERC721(nftAddress);
        nft.transferFrom(address(this), to, tokenId);
    }

    /**
     * @dev Emergency function to recover stuck ETH
     * @param to Recipient address
     * @param amount Amount to recover
     */
    function emergencyRecoverETH(address to, uint256 amount) external onlyOwner {
        require(to != address(0), "Invalid recipient");
        require(amount <= address(this).balance, "Insufficient balance");

        (bool success, ) = payable(to).call{value: amount}("");
        require(success, "Transfer failed");
    }

    // Receive function to accept ETH
    receive() external payable {
        depositETH();
    }
}

contracts/ReservedSubdomains.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

/**
 * @title ReservedSubdomains
 * @dev Manages reserved subdomains for the DAO Registry system
 * 
 * This contract provides:
 * - Reserved subdomain management with priority levels
 * - Access control for different user roles
 * - ENS integration for domain validation
 * - Dynamic reserved word updates
 */
contract ReservedSubdomains is Ownable, ReentrancyGuard {
    using Strings for string;

    /**
     * @dev Reserved subdomain priority levels
     */
    enum Priority {
        CRITICAL,   // Never available
        HIGH,       // Requires special permission
        MEDIUM,     // Available with registration
        LOW         // Available with approval
    }

    /**
     * @dev Reserved subdomain information
     */
    struct ReservedSubdomainInfo {
        string subdomain;
        Priority priority;
        string category;
        string description;
        string[] allowedRoles;
        string[] restrictions;
        bool active;
        uint256 createdAt;
        uint256 updatedAt;
    }

    /**
     * @dev Events
     */
    event SubdomainReserved(
        string indexed subdomain,
        Priority priority,
        string category,
        address indexed reservedBy
    );

    event SubdomainReleased(
        string indexed subdomain,
        address indexed releasedBy
    );

    event SubdomainUpdated(
        string indexed subdomain,
        Priority oldPriority,
        Priority newPriority,
        address indexed updatedBy
    );

    event RoleAdded(
        string indexed subdomain,
        string role,
        address indexed addedBy
    );

    event RoleRemoved(
        string indexed subdomain,
        string role,
        address indexed removedBy
    );

    /**
     * @dev State variables
     */
    mapping(string => ReservedSubdomainInfo) public reservedSubdomains;
    mapping(string => bool) public isReserved;
    mapping(string => Priority) public subdomainPriority;
    mapping(string => string[]) public subdomainCategories;

    // Access control
    mapping(address => bool) public administrators;
    mapping(address => bool) public moderators;

    // Statistics
    uint256 public totalReservedSubdomains;
    mapping(Priority => uint256) public subdomainsByPriority;
    mapping(string => uint256) public subdomainsByCategory;

    /**
     * @dev Modifiers
     */
    modifier onlyAdministrator() {
        require(administrators[msg.sender] || owner() == msg.sender, "Not authorized");
        _;
    }

    modifier onlyModerator() {
        require(moderators[msg.sender] || administrators[msg.sender] || owner() == msg.sender, "Not authorized");
        _;
    }

    modifier subdomainExists(string memory subdomain) {
        require(isReserved[subdomain], "Subdomain not reserved");
        _;
    }

    modifier subdomainNotExists(string memory subdomain) {
        require(!isReserved[subdomain], "Subdomain already reserved");
        _;
    }

    /**
     * @dev Constructor
     */
    constructor() {
        _initializeCriticalReserved();
        _initializeHighPriorityReserved();
        _initializeMediumPriorityReserved();

        // Set initial administrators
        administrators[msg.sender] = true;
    }

    /**
     * @dev Initialize critical reserved subdomains (Priority 1)
     */
    function _initializeCriticalReserved() private {
        string[] memory critical = new string[](11);
        critical[0] = "governance";
        critical[1] = "treasury";
        critical[2] = "token";
        critical[3] = "docs";
        critical[4] = "forum";
        critical[5] = "analytics";
        critical[6] = "admin";
        critical[7] = "system";
        critical[8] = "root";
        critical[9] = "www";
        critical[10] = "api";

        string[] memory allowedRoles = new string[](2);
        allowedRoles[0] = "DAO owners";
        allowedRoles[1] = "System administrators";

        string[] memory restrictions = new string[](1);
        restrictions[0] = "Never available for public registration";

        for (uint256 i = 0; i < critical.length; i++) {
            _reserveSubdomain(
                critical[i],
                Priority.CRITICAL,
                "Core DAO Components",
                "Critical system subdomain",
                allowedRoles,
                restrictions
            );
        }
    }

    /**
     * @dev Initialize high priority reserved subdomains (Priority 2)
     */
    function _initializeHighPriorityReserved() private {
        string[] memory highPriority = new string[](35);
        highPriority[0] = "voting";
        highPriority[1] = "proposals";
        highPriority[2] = "executive";
        highPriority[3] = "council";
        highPriority[4] = "vault";
        highPriority[5] = "rewards";
        highPriority[6] = "staking";
        highPriority[7] = "liquidity";
        highPriority[8] = "erc20";
        highPriority[9] = "nft";
        highPriority[10] = "vesting";
        highPriority[11] = "airdrop";
        highPriority[12] = "wiki";
        highPriority[13] = "guide";
        highPriority[14] = "spec";
        highPriority[15] = "chat";
        highPriority[16] = "discord";
        highPriority[17] = "telegram";
        highPriority[18] = "reddit";
        highPriority[19] = "stats";
        highPriority[20] = "metrics";
        highPriority[21] = "dashboard";
        highPriority[22] = "reports";
        highPriority[23] = "dev";
        highPriority[24] = "github";
        highPriority[25] = "code";
        highPriority[26] = "test";
        highPriority[27] = "staging";
        highPriority[28] = "gov";
        highPriority[29] = "constitution";
        highPriority[30] = "bylaws";
        highPriority[31] = "policies";
        highPriority[32] = "marketing";
        highPriority[33] = "brand";
        highPriority[34] = "media";

        string[] memory allowedRoles = new string[](1);
        allowedRoles[0] = "DAO owners";

        string[] memory restrictions = new string[](1);
        restrictions[0] = "Requires special permission";

        for (uint256 i = 0; i < highPriority.length; i++) {
            _reserveSubdomain(
                highPriority[i],
                Priority.HIGH,
                "High Priority",
                "High priority subdomain",
                allowedRoles,
                restrictions
            );
        }
    }

    /**
     * @dev Initialize medium priority reserved subdomains (Priority 3)
     */
    function _initializeMediumPriorityReserved() private {
        string[] memory mediumPriority = new string[](25);
        mediumPriority[0] = "faq";
        mediumPriority[1] = "help";
        mediumPriority[2] = "support";
        mediumPriority[3] = "news";
        mediumPriority[4] = "announcements";
        mediumPriority[5] = "monitor";
        mediumPriority[6] = "status";
        mediumPriority[7] = "health";
        mediumPriority[8] = "alerts";
        mediumPriority[9] = "tech";
        mediumPriority[10] = "protocol";
        mediumPriority[11] = "contracts";
        mediumPriority[12] = "audit";
        mediumPriority[13] = "legal";
        mediumPriority[14] = "compliance";
        mediumPriority[15] = "regulatory";
        mediumPriority[16] = "kyc";
        mediumPriority[17] = "events";
        mediumPriority[18] = "social";
        mediumPriority[19] = "twitter";
        mediumPriority[20] = "linkedin";
        mediumPriority[21] = "manage";
        mediumPriority[22] = "settings";
        mediumPriority[23] = "config";
        mediumPriority[24] = "service";

        string[] memory allowedRoles = new string[](2);
        allowedRoles[0] = "DAO owners";
        allowedRoles[1] = "Verified users";

        string[] memory restrictions = new string[](1);
        restrictions[0] = "Available with registration";

        for (uint256 i = 0; i < mediumPriority.length; i++) {
            _reserveSubdomain(
                mediumPriority[i],
                Priority.MEDIUM,
                "Medium Priority",
                "Medium priority subdomain",
                allowedRoles,
                restrictions
            );
        }
    }

    /**
     * @dev Reserve a subdomain
     */
    function _reserveSubdomain(
        string memory subdomain,
        Priority priority,
        string memory category,
        string memory description,
        string[] memory allowedRoles,
        string[] memory restrictions
    ) private {
        require(bytes(subdomain).length > 0, "Subdomain cannot be empty");
        require(!isReserved[subdomain], "Subdomain already reserved");

        ReservedSubdomainInfo memory info = ReservedSubdomainInfo({
            subdomain: subdomain,
            priority: priority,
            category: category,
            description: description,
            allowedRoles: allowedRoles,
            restrictions: restrictions,
            active: true,
            createdAt: block.timestamp,
            updatedAt: block.timestamp
        });

        reservedSubdomains[subdomain] = info;
        isReserved[subdomain] = true;
        subdomainPriority[subdomain] = priority;

        // Update statistics
        totalReservedSubdomains++;
        subdomainsByPriority[priority]++;
        subdomainsByCategory[category]++;

        emit SubdomainReserved(subdomain, priority, category, msg.sender);
    }

    /**
     * @dev Reserve a new subdomain (admin only)
     */
    function reserveSubdomain(
        string memory subdomain,
        Priority priority,
        string memory category,
        string memory description,
        string[] memory allowedRoles,
        string[] memory restrictions
    ) external onlyAdministrator subdomainNotExists(subdomain) {
        _reserveSubdomain(subdomain, priority, category, description, allowedRoles, restrictions);
    }

    /**
     * @dev Release a reserved subdomain
     */
    function releaseSubdomain(string memory subdomain) 
        external 
        onlyAdministrator 
        subdomainExists(subdomain) 
    {
        ReservedSubdomainInfo storage info = reservedSubdomains[subdomain];
        Priority priority = info.priority;
        string memory category = info.category;

        // Update statistics
        totalReservedSubdomains--;
        subdomainsByPriority[priority]--;
        subdomainsByCategory[category]--;

        // Clear data
        delete reservedSubdomains[subdomain];
        delete isReserved[subdomain];
        delete subdomainPriority[subdomain];

        emit SubdomainReleased(subdomain, msg.sender);
    }

    /**
     * @dev Update subdomain priority
     */
    function updateSubdomainPriority(string memory subdomain, Priority newPriority) 
        external 
        onlyModerator 
        subdomainExists(subdomain) 
    {
        ReservedSubdomainInfo storage info = reservedSubdomains[subdomain];
        Priority oldPriority = info.priority;

        // Update statistics
        subdomainsByPriority[oldPriority]--;
        subdomainsByPriority[newPriority]++;

        // Update info
        info.priority = newPriority;
        info.updatedAt = block.timestamp;
        subdomainPriority[subdomain] = newPriority;

        emit SubdomainUpdated(subdomain, oldPriority, newPriority, msg.sender);
    }

    /**
     * @dev Update subdomain category
     */
    function updateSubdomainCategory(string memory subdomain, string memory newCategory) 
        external 
        onlyModerator 
        subdomainExists(subdomain) 
    {
        ReservedSubdomainInfo storage info = reservedSubdomains[subdomain];
        string memory oldCategory = info.category;

        // Update statistics
        subdomainsByCategory[oldCategory]--;
        subdomainsByCategory[newCategory]++;

        // Update info
        info.category = newCategory;
        info.updatedAt = block.timestamp;

        emit SubdomainUpdated(subdomain, info.priority, info.priority, msg.sender);
    }

    /**
     * @dev Add role to subdomain
     */
    function addRoleToSubdomain(string memory subdomain, string memory role) 
        external 
        onlyModerator 
        subdomainExists(subdomain) 
    {
        ReservedSubdomainInfo storage info = reservedSubdomains[subdomain];

        // Check if role already exists
        for (uint256 i = 0; i < info.allowedRoles.length; i++) {
            require(keccak256(bytes(info.allowedRoles[i])) != keccak256(bytes(role)), "Role already exists");
        }

        info.allowedRoles.push(role);
        info.updatedAt = block.timestamp;

        emit RoleAdded(subdomain, role, msg.sender);
    }

    /**
     * @dev Remove role from subdomain
     */
    function removeRoleFromSubdomain(string memory subdomain, string memory role) 
        external 
        onlyModerator 
        subdomainExists(subdomain) 
    {
        ReservedSubdomainInfo storage info = reservedSubdomains[subdomain];

        bool found = false;
        for (uint256 i = 0; i < info.allowedRoles.length; i++) {
            if (keccak256(bytes(info.allowedRoles[i])) == keccak256(bytes(role))) {
                // Remove role by shifting array
                for (uint256 j = i; j < info.allowedRoles.length - 1; j++) {
                    info.allowedRoles[j] = info.allowedRoles[j + 1];
                }
                info.allowedRoles.pop();
                found = true;
                break;
            }
        }

        require(found, "Role not found");
        info.updatedAt = block.timestamp;

        emit RoleRemoved(subdomain, role, msg.sender);
    }

    /**
     * @dev Check if subdomain is reserved
     */
    function checkIfReserved(string memory subdomain) external view returns (bool) {
        return isReserved[subdomain];
    }

    /**
     * @dev Get subdomain priority
     */
    function getSubdomainPriority(string memory subdomain) external view returns (Priority) {
        return subdomainPriority[subdomain];
    }

    /**
