     */
    function getReservedSubdomainInfo(string memory subdomain) 
        external 
        view 
        returns (ReservedSubdomainInfo memory) 
    {
        require(isReserved[subdomain], "Subdomain not reserved");
        return reservedSubdomains[subdomain];
    }

