    /**
     * @dev Get statistics
     */
    function getStatistics() 
        external 
        view 
        returns (
            uint256 total,
            uint256 critical,
            uint256 high,
            uint256 medium,
            uint256 low
        ) 
    {
        return (
            totalReservedSubdomains,
